There are several artists artists using the name "Max";


1) "Max" is Max Schneider, signed to DCD2. He released Mug Shot and The Say Max - EP in 2014. Gibberish (feat. Hoodie Allen) was released in 2015. His song "Lights Down Low" peaked at #20 on the Hot 100 in 2018.

2)  "MAX", which is short for Musical Active eXperience, is a Japanese pop group. Original members Mina, Reina, Lina and Nana formed MAX from their original group ,SUPER MONKEY'S in 1995 and released their debut single in May of that year. <a href="https://www.last.fm/music/Max">Read more on Last.fm</a>
